import React, { useState } from "react";
import "./Home.css";
import SimpleImageSlider from "react-simple-image-slider";
import HR3 from "./images/HR-3.jpg";
import HR1 from "./images/HR-1.jpg";
import leadership from "./images/leadership.jpg";
import about from "./images/about-us.jpg"; 
import border from "./images/m-1.png";
import Container from "@mui/material/Container"; 

function Home() {

    const sliderImages = [
        {
            url: HR3,
        },
        {
            url: HR1,
        },
        {
            url: leadership,
        },
    ];

    return (
        <div className="content-container">
            <div className="slider">
                <SimpleImageSlider
                    width={"100%"}
                    height={"100%"}
                    autoPlay={true}
                    autoPlayDelay = {3}
                    images={sliderImages}
                    showNavs={true}
                />
                <div className="about">
                <div className="leftalgin">
                    <img src={about} width={250} height={250} alt="About us"/>
                </div>
                <div>
                    <div>
                        <h2>About Quintessence Search Labs</h2>
                    </div>
                    <div>
                        <img src={border}/>
                    </div>
                </div>
            </div>
            </div>
            
        </div>
    );
}


export default Home;
